  const d = qs.stringify({"username": "admin",
                            "password": "petrol4ever"});
  console.log(d);
  return axios({
    method: 'post',
    url: 'https://localhost:8765/evcharge/api/login',
    headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
